import React from 'react';

function BookTableItem(props){
    const { book } = this.props;
    return(
        <tr>
            <td>{book.getTitle()}</td>
            <td>{book.getAuthor()}</td>
            <td>{book.getWasRead() ? 'Si' : 'No'}</td>
        </tr>
    );
}
export default BookTableItem;

